import React from 'react';


const PostStamp = (props) => {
    return (
        <img 
            src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/3/stampTiles.svg" 
            className="postStamp"
            width="200rem"
            height="120rem"
        />
    );

}


export default PostStamp;
